【用途・使用法】<br>
●冷蔵庫の外側・照明器具のカサ・鏡等に：無水エタノールを布などに含ませてふいて下さい。(冷蔵庫の庫内に食品や汁のこぼれ汚れがある場合、無水エタノールを含ませた布などでふき取って下さい。)<br>
●換気扇・レンジ・オーブン・レンジまわりの壁等に：無水エタノールを布などに含ませてふき取って下さい。<br>
●便器・便座等に： 無水エタノールを布などに含ませてふいて下さい。<br>
●密閉容器についた食品の臭いとりに：無水エタノールを布などに含ませて、容器の内外をよくふき取って下さい。<br><br>

【ご注意】<br>
○引火しやすいので、火気の近くでは使用しないで下さい。<br>
○電化製品(樹脂製品等も含む)に使用される場合には、その商品の説明書きをよく読んでから使用して下さい。<br>
○用途以外には使用しないで下さい。<br>
○一度に大量に使用しないで下さい。<br>
○みだりに加熱、加減圧したり噴霧、蒸発させないで下さい。<br>
○使用する場合は、こぼしたり、又は飛散しないように注意し、換気を充分に行なって下さい。<br>
○目、その他粘膜等に触れないよう注意して下さい。<br>
○飲んではいけません。<br>
○シミ、変色の原因となりますので、家具・床(ワックス掛けを含む)などの白木、桐、ニス、ラッカー塗装品などに使用しないで下さい。<br>
○使用期限を過ぎた製品は使用しないで下さい。<br>
○直射日光の当たらない涼しい所に密栓して保管して下さい。<br>
○小児の手の届かない所に保管して下さい。<br>
○他の容器に入れ替えないで下さい。(誤用の原因になったり、品質が変わることがあります。)<br>
○火気に近づけないで下さい。(火気その他着火源(静電気を含む。)から離して保管して下さい。)<br>
○初期火災の場合には、大量の水又は消火器で消火して下さい。<br>
○万一、目その他粘膜等に触れた場合は、大量の水で洗い流し、飲み込んだ場合は、水を飲ませて吐かせる等の処置をして医師の手当てを受けて下さい。<br><br>

【組成・性状】<br>
エタノール (C2H6O) 99.5vol%以上を含有する。無色澄明の液である。<br><br>

【内容量】<br>
500ml<br><br>

【販売元】<br>
健栄製薬株式会社<br>
大阪市中央区伏見町2-5-8<br>
お問い合わせ先：06-6231-5626<br><br>

【商品区分】<br>
日用品<br><br>

［ケンエー］

